  guardarProductoIndividualV(i) {
    const fila = this.productosVencidos.at(i);
    if (!fila)
      return;
    const id = fila.get("id")?.value;
    const tipo = fila.get("tipo")?.value;
    const cantidad = fila.get("cantidad")?.value;
    const idFicha = this.ficha4Form.get("idFicha")?.value;
    if (!tipo || tipo.trim() === "" || !cantidad || cantidad <= 0) {
      import_sweetalert24.default.fire({ icon: "warning", title: "Datos incompletos", text: "Debe ingresar tipo y cantidad v\xE1lida" });
      return;
    }
    const data = { id, tipo, cantidad, idFicha };
    this.http.post("/api/ficha/guardarProductoVencidoIndividual", data).subscribe({
      next: (resp) => {
        if (!id && resp?.id) {
          fila.get("id")?.setValue(resp.id);
        }
        this.estadoFilasGuardadasV[i] = true;
        import_sweetalert24.default.fire({ icon: "success", title: "Guardado", timer: 1200, showConfirmButton: false });
      },
      error: () => {
        import_sweetalert24.default.fire({ icon: "error", title: "Error", text: "No se pudo guardar el producto." });
      }
    });
  }
  cargarProductosVencidos(idFicha) {
    this.http.get(`/api/ficha/obtenerProductosVencidos/${idFicha}`).subscribe({
      next: (productos) => {
        console.log("Productos recibidos:", productos);
        const productosFormArray = this.ficha4Form.get("productosVencidos");
        productosFormArray.clear();
        productos.forEach((prod) => {
          productosFormArray.push(this.fb.group({
            id: [prod.id],
            tipo: [prod.tipo],
            cantidad: [prod.cantidad]
          }));
        });
        this.estadoFilasGuardadasV = productos.map(() => true);
      },
      error: (err) => {
        console.error("Error al cargar productos vencidos:", err);
      }
    });
  }
  eliminarFilaProductoV(index) {
    const fila = this.productosVencidos.at(index);
    const id = fila?.get("id")?.value;
    if (!id) {
      this.productosVencidos.removeAt(index);
      this.estadoFilasGuardadas.splice(index, 1);
      return;
    }
    import_sweetalert24.default.fire({
      icon: "question",
      title: "\xBFEliminar producto?",
      text: "Esta acci\xF3n no se puede deshacer.",
      showCancelButton: true,
      confirmButtonText: "S\xED, eliminar",
      cancelButtonText: "Cancelar"
    }).then((result) => {
      if (result.isConfirmed) {
        this.http.delete(`/api/ficha/eliminarProductoVencido/${id}`).subscribe({
          next: () => {
            this.productosVencidos.removeAt(index);
            this.estadoFilasGuardadas.splice(index, 1);
            import_sweetalert24.default.fire({
              icon: "success",
              title: "Producto eliminado",
              timer: 1200,
              showConfirmButton: false
            });
          },
          error: (err) => {
            console.error("Error al eliminar producto:", err);
            import_sweetalert24.default.fire({
              icon: "error",
              title: "Error al eliminar",
              text: "No se pudo eliminar el producto."
            });
          }
        });
      }
    });
  }
