  controlarCampoCondicionalConRadioYDetalleSimplificado(campoCondicionalName, campoRadioName, campoDetalleName) {
    const campoCondicional = this.ficha6Form.get(campoCondicionalName);
    const campoRadio = this.ficha6Form.get(campoRadioName);
    const campoDetalle = this.ficha6Form.get(campoDetalleName);
    if (!campoCondicional || !campoRadio || !campoDetalle)
      return;
    campoCondicional.valueChanges.subscribe((valor) => {
      if (valor) {
        campoRadio.setValidators([Validators.required]);
        campoRadio.enable();
        campoRadio.updateValueAndValidity();
      } else {
        campoRadio.reset();
        campoRadio.clearValidators();
        campoRadio.disable();
        campoRadio.updateValueAndValidity();
        campoDetalle.enable();
        campoDetalle.setValue("");
        campoDetalle.reset();
        campoDetalle.clearValidators();
        campoDetalle.setErrors(null);
        campoDetalle.updateValueAndValidity();
      }
    });
    if (!campoCondicional.value) {
      campoRadio.reset();
      campoRadio.clearValidators();
      campoRadio.disable();
      campoRadio.updateValueAndValidity();
      campoDetalle.enable();
      campoDetalle.setValue("");
      campoDetalle.reset();
      campoDetalle.disable();
      campoDetalle.clearValidators();
      campoDetalle.setErrors(null);
      campoDetalle.updateValueAndValidity();
    } else {
      campoRadio.setValidators([Validators.required]);
      campoRadio.enable();
      campoRadio.updateValueAndValidity();
    }
  }
